import Title from '../../components/Title/Title'
import Text from '../../components/Text/Text'
import Image from '../../components/Image/Image'

const Care = ({className, data}) => {
  const {
    title, 
    texts, 
    image
  } = data

  return (
    <section 
      data-name={className}
      className={className ? className : 'care'}
    >
      <div className='container'>
        <div className={`${className}__wrapper`}>
          <div className={`${className}__body`}>
            {title && 
              <Title 
                className={className} 
                title={title}/> 
            }
            {texts && (
              texts.map((text, i) => 
                <Text 
                  className={className} 
                  text={text} 
                  key={i}/>
              )
            )}                 
          </div>
          <div className={`${className}__image`}>
            <Image 
              dataType={className} 
              image={image}

            />
          </div>
        </div>
      </div>
    </section>
  )
}

export default Care
